import { Welcome } from './Welcome'

export const App = () => {
    let user;

    const ubah = (cb) => {
        return(
            user = "Edward",
            console.log(user),
            tampil()
        );
    }
    const tampil = () =>{
        <Welcome name={user}/>
    }
  return (
    <div>
        <button onClick={() => ubah(tampil())}>Login</button>
        <p>user</p>
    </div>
  )
  
}
